import React from 'react';
import './App.css';
import ChatInterface from './components/ChatInterface';

function App() {
  return (
    <div className="App">
      <header className="glass" style={{ 
        padding: '1.5rem',
        margin: '2rem 1rem',
        position: 'relative'
      }}>
        <h1 style={{
          margin: 0,
          fontSize: '28px',
          color: 'var(--text-primary)',
          textAlign: 'center'
        }}>SQL Query Generator</h1>
      </header>
      <main style={{ padding: '0 1rem' }}>
        <ChatInterface />
      </main>
    </div>
  );
}

export default App;
